const baseUrl = 'http://localhost:3000/image';

export const postImage = (image) => {

    console.log(89);
    return fetch(baseUrl, { 
         method: 'PUT',
         //headers: {'content-type': 'application/json'},
         body: image
     }).then((result) => result.json)
     .catch(error => console.log(error))
}
